import React from 'react';
import Header from './Header';
import '../App.css';
import Search from './Search';

function App() {

  let list = [];


  const search = (searchValue) => {
    list.push({
        flag:true,
        value:searchValue
    });

    console.log(list,"asda")
  }

  return (
    <div className="App">
      <Header title="Todo Application"/>
      <Search search={search}/>
      <div className = "movies">
        list.map((list, index) => (
            <Movies key={`${index}-${list.value}`} list={list} />
          ))
     </div>
     </div>
  );
}

export default App;
